import React from "react";
import Header from "./components/Header";
import Sidebar from "./components/Sidebar";
import MainContent from "./components/MainContent";
import Footer from "./components/Footer";
import GlobalStyles from "./components/GlobalStyles"; // You might want to define global styles

const mockMovies = [
  { id: 1, title: "Movie 1", imageUrl: "movie1.jpg" },
  { id: 2, title: "Movie 2", imageUrl: "movie2.jpg" },
  // Add more movie data as needed
];

function App() {
  return (
    <div>
      <GlobalStyles /> {/* Include global styles */}
      <Header />
      <Sidebar />
      <MainContent movies={mockMovies} />
      <Footer />
    </div>
  );
}

export default App;
